"<p style=\"-qt-paragraph-type:empty; margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; font-family:\'Helvetica Neue,Helvetica,Arial,sans-serif\'; font-size:11pt; font-weight:600; color:#444444;\"><br /></p>\n"
